
import time


string1 = ""
string2 = ""

def lcs(str1, str2):
    len1 = len(str1)
    len2 = len(str2)
    arr = [[0 for index1 in range(len2+1)] for index1 in range(len1+1)]   
    for index1 in range(1, len1+1):
        for index2 in range(1, len2+1):
            if index1 == 0 or index2 == 0:
                arr[index1][index2] = 0
            elif str1[index1-1] == str2[index2-1]:
                arr[index1][index2] = 1 + arr[index1-1][index2-1]
            else:
                arr[index1][index2] = max(arr[index1-1][index2], arr[index1][index2-1])
    i = arr[len1][len2]
    res = [""] * i
    index1 = len1
    index2 = len2
    while index1 > 0 and index2 > 0:
        if str1[index1-1] == str2[index2-1]:
            res[i-1] = str1[index1-1]
            index1 -= 1
            index2 -= 1
            i -= 1
        elif arr[index1-1][index2] > arr[index1][index2-1]:
            index1 -= 1
        else:
            index2 -= 1
    return res


start_time = time.perf_counter()

l=lcs(string1,string2)

end_time = time.perf_counter()

ans=""
print(ans.join(l))
print(f"LCS took {end_time - start_time:0.4f} seconds")


